import React from "react";

function Applicants_Page({ adId, findFullProfiles, hideButton }) {
  const buttonMethods = () => {
    findFullProfiles();
    hideButton();
  };

  return (
    <div>
      <div class="hero-create-ad vh-120 d-flex align-items-center ">
        <div class="container base-sign-container-create-ad bg-white col-6">
          <div class="row justify-content-center mt-3">
            <div class="col-md-3"></div>
          </div>

          <div class="row">
            <div class="col-md-12 form-title"></div>
          </div>

          <div class="row">
            <div class="col-md-12 form-title">
              <br></br>
            </div>
          </div>

          <div class="row mb-4 mt-4">
            <div class="col-md-4 form-title"></div>
          </div>

          <div class="row  mb-4 mt-4">
            <div class="col-md-6 form-title">
              <br></br>

              <br></br>
            </div>

            <div class="col-md-6 "></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Applicants_Page;
